INSERT INTO `appqueries` (`id`, `querycode`, `description`, `query`, `dateentered`) VALUES
(1, 'user_login', 'Picks an active user''s details who matches the pair _USERNAME_ and _PASSWORD_', 'SELECT * FROM(\r\nSELECT id as userid, school,username, isadmin, isschooladmin, usertype, password ,accessgroup, emailaddress, firstname, middlename,\r\nlastname,photo\r\nFROM users\r\nUNION ALL\r\nSELECT id,school,username,isusertype,isschooladmin,usertype, password, usergroup,emailaddress,firstname,middlename,\r\nlastname,photo\r\nFROM  schoolusers\r\nUNION ALL\r\nSELECT id,''NONE'', username AS username,isadmin,''NONE'',''ACCOUNT_OWNER'', password, ''12'', email AS emailaddress, account_name,''NONE'' , ''NONE'', ''NONE''  FROM academia_accounts\r\n  )  AS users\r\n\r\n  \r\n  WHERE username = ''_USERNAME_''  AND password = ''_PASSWORD_''', '2010-10-19 13:13:13'),
(2, 'delete_old_captchas', 'Deletes old captcha images', 'DELETE FROM captcha WHERE captcha_time < ''_OLDESTTIME_''', '2011-02-11 19:46:11'),
(3, 'check_for_captcha', 'Checks for a captcha image from its database table', 'SELECT COUNT(*) AS count FROM captcha WHERE word = ''_THEWORD_'' AND ip_address = ''_THISIP_'' AND captcha_time > ''_OLDESTDATE_''', '2011-02-11 19:49:16'),
(4, 'insert_captcha_record', 'Add a captcha record', 'INSERT INTO captcha (captcha_time, ip_address, word) VALUES (''_CAPTCHA_TIME_'', ''_IP_ADDRESS_'', ''_WORD_'')', '2012-10-17 21:35:45'),
(5, 'add_testimonial', 'Add a testimonial', 'INSERT INTO testimonials (firstname, lastname, emailaddress, testimonial, dateadded) VALUES (''_FIRSTNAME_'', ''_LASTNAME_'', ''_EMAILADDRESS_'', ''_TESTIMONIAL_'', NOW())', '2012-10-17 22:19:00'),
