(8, 'delete_testimonial', 'Delete testimonial', 'DELETE FROM testimonials WHERE id=''_ID_''', '2012-10-17 23:03:43'),
(9, 'get_user_by_id', 'Get a user by ID', 'SELECT users.*, users.id AS userid FROM users WHERE id=''_ID_''', '2012-10-18 21:56:08'),
