(18, 'search_general_user_list', 'Search general user list', 'SELECT U.*, O.organizationname FROM users U LEFT JOIN organizations O ON (O.id=U.companyid) WHERE U.isactive=''Y''  AND U.usertype IN (''QC'',''QIB'',''AC'') AND U.isadmin = ''N'' _SEARCHSTRING_ ORDER BY U.username _LIMITTEXT_', '2012-11-27 17:53:54'),
