(37, 'insert_news_article', 'Create a news article', 'INSERT INTO `news` (`title`,`articlelink`,`hasvideo`,`affectedfund`,`newsdate`,`newstime`,`addedby`) VALUES (''_TITLE_'',''_ARTICLELINK_'',''_HASVIDEO_'',''_AFFECTEDFUND_'',''_NEWSDATE_'',''_NEWSTIME_'',''_ADDEDBY_'')', '2012-11-30 00:00:00'),
