(84, 'get_user_settings_by_id', 'Get the user distribution settings given its ID', 'SELECT U.id AS userid, U.firstname, U.lastname, U.emailaddress, C.pushfrequency FROM users U LEFT JOIN commsettings C ON (U.id=C.userid) WHERE U.id=''_USERID_'' LIMIT 0,1', '2012-12-13 15:03:27'),
