(99, 'get_organization_by_id', 'Get the organization by ID', 'SELECT *, symbol AS fundsymbol FROM organizations WHERE id=''_ID_''', '2012-12-15 14:47:43'),
(100, 'update_organization', 'Update organization data', 'UPDATE organizations SET organizationname=''_ORGANIZATIONNAME_'', datestarted=''_DATESTARTED_'', symbol=''_FUNDSYMBOL_'', contactperson=''_CONTACTPERSON_'', contactemail=''_CONTACTEMAIL_'', contactphone=''_CONTACTPHONE_'', contactaddressline1=''_CONTACTADDRESSLINE1_'', contactaddressline2=''_CONTACTADDRESSLINE2_'', contactcity=''_CONTACTCITY_'', contactzipcode=''_CONTACTZIPCODE_'', contactstate=''_CONTACTSTATE_'', logourl=''_LOGOURL_'', iconurl=''_ICONURL_'' WHERE id=''_EDITID_''', '2012-12-15 16:42:32'),
(101, 'save_new_organization', 'Save a new organization', 'INSERT INTO organizations (organizationname, datestarted, symbol, contactperson, contactemail, contactphone, contactaddressline1, contactaddressline2, contactcity, contactzipcode, contactstate, logourl, iconurl) VALUES (''_ORGANIZATIONNAME_'', ''_DATESTARTED_'', ''_FUNDSYMBOL_'', ''_CONTACTPERSON_'', ''_CONTACTEMAIL_'', ''_CONTACTPHONE_'', ''_CONTACTADDRESSLINE1_'', ''_CONTACTADDRESSLINE2_'', ''_CONTACTCITY_'', ''_CONTACTZIPCODE_'', ''_CONTACTSTATE_'', ''_LOGOURL_'', ''_ICONURL_'')', '2012-12-15 16:47:12'),
(102, 'insert_organization', 'Creates a new organization', 'INSERT INTO organizations (organizationname, datestarted, symbol, contactperson, contactemail, contactphone, contactaddressline1, contactaddressline2, contactcity, contactzipcode, contactstate) VALUES (''_ORGANIZATIONNAME_'', ''_DATESTARTED_'' ,''_SYMBOL_'', ''_CONTACTPERSON_'', ''_CONTACTEMAIL_'', ''_CONTACTPHONE_'', ''_CONTACTADDRESSLINE1_'', ''_CONTACTADDRESSLINE2_'', ''_CONTACTCITY_'', ''_CONTACTZIPCODE_'', ''_CONTACTSTATE_'')', '2012-12-16 17:33:48'),
(103, 'get_users_news_list', 'Get users news list', 'SELECT R.newsid, R.userid, N.title, N.articlelink, N.hasvideo, N.affectedfund, N.newsdate FROM newsreadstatus R LEFT JOIN news N ON (R.newsid=N.id) WHERE R.issent=''Y'' AND R.userid=''_USERID_'' AND N.isactive=''_ISACTIVE_'' _SEARCHSTRING_ ORDER BY R.datesent _LIMITTEXT_', '2012-12-17 21:31:36'),
(104, 'update_group_name', 'Updates the group name', 'UPDATE emailgroups SET groupname = ''_NEWNAME_'' WHERE groupname = ''_OLDNAME_''', '2012-12-18 11:37:05'),
(105, 'search_email_groups', 'Search email groups', 'SELECT G.groupname, U.firstname, U.lastname, U.emailaddress FROM emailgroups G LEFT JOIN users U ON (G.userid=U.id) WHERE G.isactive=''Y'' AND groupname LIKE ''%_PHRASE_%'' ORDER BY groupname _LIMITTEXT_', '2012-12-18 15:54:22'),
(110, 'update_ndasigned_by_id', 'Update NDA Signed status given its ID', 'UPDATE invitations SET ndasigned=''_NDASIGNED_'' WHERE id=''_INVID_''', '2012-12-20 18:40:10'),
(127, 'delete_news', 'Deletes a news article', 'DELETE FROM news WHERE `newsid` = ''_NEWSID_''', '2012-12-19 00:00:00'),
(128, 'restore_news', 'unarchive a news item', 'UPDATE news SET isactive = ''Y'' WHERE id = ''_NEWSID_''', '2012-12-19 20:28:42'),
(146, 'get_inv_response_list', 'Get invitation response list', 'SELECT \r\nI.*, \r\nD.dealtype, D.dealid AS dealstamp, D.dealdescription, D.fundsymbol, U.firstname, U.lastname, \r\n(SELECT organizationname FROM organizations WHERE id=U.companyid) AS organization, \r\n(SELECT COUNT(id) FROM ordertickets WHERE orderedby=I.userid AND dealid=I.dealid) AS responsecount, \r\n\r\nIF(I.isread = ''N'', 0, (UNIX_TIMESTAMP(CONCAT(I.dateread,'' '', INSERT(I.dateread, 3, 0, '':''), '':00'')) - UNIX_TIMESTAMP(CONCAT(I.datesent,'' '', INSERT(I.datesent, 3, 0, '':''), '':00'')) ) / 3600) AS datediff\r\n\r\nFROM invitations I \r\nLEFT JOIN deals D ON (D.id=I.dealid) \r\nLEFT JOIN users U ON (U.id=I.userid) \r\n\r\nWHERE D.isactive=''_ISACTIVE_'' _SEARCHSTRING_ \r\nORDER BY I.datesent DESC _LIMITTEXT_', '2012-12-01 12:47:15'),
(148, 'get_help_topic', 'Get help topic', 'SELECT DISTINCT topiccode, helptopic FROM help WHERE 1=1 _SEARCHSTRING_ ORDER BY topiccode _LIMITTEXT_', '2012-12-14 17:14:48'),
(149, 'add_help_item', 'Add a help item', 'INSERT INTO help (topiccode, helptopic, details, helplink, fileurl, helporder, lastupdated) VALUES (''_TOPICCODE_'', ''_HELPTOPIC_'', ''_DETAILS_'', ''_HELPLINK_'', ''_FILEURL_'', ''_HELPORDER_'', NOW())', '2012-12-04 21:59:28'),
(150, 'remove_help_item', 'Remove help item', 'DELETE FROM help WHERE id=''_ID_''', '2012-12-13 23:12:25'),
(152, 'get_help_list', 'Get the list of help for use by the admin', 'SELECT DISTINCT H.topiccode, H.helptopic, (SELECT MAX(lastupdated) FROM help WHERE topiccode=H.topiccode) AS lastupdateddate FROM help H WHERE H.topiccode IS NOT NULL _SEARCHSTRING_ ORDER BY H.helptopic _LIMITTEXT_', '2012-12-17 15:28:38'),
(153, 'get_users_in_list', 'Get users in list', 'SELECT U.*, O.organizationname, U.id AS userid FROM users U LEFT JOIN organizations O ON (U.organization=O.id) WHERE U.id IN (_IDLIST_)', '2013-01-01 21:45:45'),
(154, 'get_active_user_emails', 'Get the active user emails', 'SELECT GROUP_CONCAT(emailaddress) AS emaillist FROM users WHERE isactive=''_ISACTIVE_''', '2013-01-01 22:46:04'),
(155, 'get_userlist_emails', 'Get the user list emails', 'SELECT GROUP_CONCAT(emailaddress) AS emaillist FROM users WHERE id IN (_IDLIST_)', '2013-01-01 22:47:44'),
(156, 'save_new_message', 'Save new message', 'INSERT INTO messages (subject, details, sentby, datesent, sendingip, isactive) VALUES (''_SUBJECT_'', ''_DETAILS_'', ''_SENTBY_'', NOW(), ''_SENDINGIP_'', ''Y'')', '2013-01-01 22:51:08'),
(157, 'add_msg_read_record', 'A message read record', 'INSERT INTO msgreadstatus (useremail, userid, messageid, isread, readip, datesent) VALUES (''_USEREMAIL_'', ''_USERID_'', ''_MESSAGEID_'', ''N'', '''', NOW())', '2013-01-01 23:31:39'),
(158, 'get_message_list', 'Get message list', 'SELECT R.*, M.subject FROM msgreadstatus R LEFT JOIN messages M ON (R.messageid=M.id) WHERE R.showmsg=''Y'' AND M.isactive=''_ISACTIVE_'' AND R.userid=''_USERID_'' _SEARCHSTRING_ ORDER BY R.isread DESC, R.datesent DESC _LIMITTEXT_', '2013-01-01 23:57:51'),
(159, 'get_message_read_by_id', 'Get the message details by its read record', 'SELECT R.*, M.subject, M.details, M.datesent AS messagedate, M.sentby, (SELECT CONCAT(firstname, '' '', lastname, '' ('', emailaddress, '')'') FROM users WHERE id=M.sentby) AS sentbydetails FROM msgreadstatus R LEFT JOIN messages M ON (R.messageid=M.id) WHERE R.id=''_ID_'' ', '2013-01-02 09:57:36'),
(160, 'update_message_read_status', 'Update the message read status', 'UPDATE msgreadstatus SET readip=''_READIP_'', isread=''_ISREAD_'', dateread=NOW() WHERE id=''_ID_''', '2013-01-01 10:10:03'),
(161, 'get_recipients_list', 'Get recipients list', 'SELECT R.*, CONCAT(U.firstname, '' '', U.lastname) AS name FROM msgreadstatus R LEFT JOIN users U ON (U.id=R.userid) WHERE messageid=''_MSGID_''', '2013-01-01 20:54:05'),
