(266, 'student_accounts_overview', 'gets a summary of student account details', 'SELECT students.id as studentid, firstname, lastname,isactive, IF(debits.totaldebit IS NULL , 0, debits.totaldebit) AS studentdebit, IF(credits.totalcredit IS NULL , 0, credits.totalcredit) AS studentcredit FROM students LEFT OUTER JOIN  (\nSELECT student, IF( sum( amount) IS NULL , 0, sum( amount ) ) AS totalcredit FROM `studentaccounts` WHERE type = ''CREDIT'' AND school = ''_SCHOOL_'' group by student ) as credits ON students.id = credits.student LEFT OUTER JOIN\n(\nSELECT student, IF( sum( amount ) IS NULL , 0, sum( amount ) ) AS totaldebit\nFROM `studentaccounts`\nWHERE TYPE = ''DEBIT''\nAND school =''_SCHOOL_''\nGROUP BY student ) as debits ON students.id = debits.student\nWHERE students.school = ''_SCHOOL_'' _LIMITTEXT_', '2013-03-15 09:17:00'),
