(369, 'get_subject_teachers', 'Retrieve teachers of a particular subject', 'SELECT subjectteacherassignments.id AS assignmentid, subjectteacherassignments.paper AS paperid, subjectpapers.paper AS paper, CONCAT(schoolusers.firstname, '' '', schoolusers.lastname) AS teacher, classes.class AS class FROM subjectteacherassignments INNER JOIN schoolusers ON schoolusers.id = subjectteacherassignments.teacher INNER JOIN classes ON classes.id = subjectteacherassignments.class LEFT OUTER JOIN subjectpapers ON subjectteacherassignments.paper = subjectpapers.id  WHERE subjectteacherassignments.subject = ''_SUBJECT_''', '2013-04-27 00:00:00'),
