(379, 'get_teacher_subjects', 'get the selected teachers subject details', 'SELECT subjectteacherassignments.id AS assignmentid, subjects.id AS subjectid, classes.id AS classid, subjects.subject AS subjectname, classes.class as classname  FROM subjectteacherassignments INNER JOIN subjects ON subjects.id = subjectteacherassignments.subject INNER JOIN classes ON subjectteacherassignments.class = classes.id WHERE teacher = ''_TEACHER_''', '2012-10-17 22:41:19'),
(380, 'get_students_registered_by_subject', 'Get the list of students who have registered to do a specified subject for a give time', 'SELECT CONCAT(students.firstname,'' '', students.lastname) AS studentname, students.id AS studentid, register.id AS registerid FROM register INNER JOIN students ON register.student = students.id WHERE register.school = ''_SCHOOL_'' AND register.term = ''_TERM_'' AND register.class=''_CLASS_'' AND register.subjects like ''%|_SUBJECTS_|%''', '2012-10-17 22:41:19'),
(381, 'get_current_term', 'Get the current term of a school', 'SELECT * FROM terms WHERE school = ''_SCHOOL_'' AND startdate < NOW() AND enddate > NOW() AND isactive=''Y'' ORDER BY enddate ASC, startdate DESC', '2012-10-18 21:56:08'),
(382, 'subject_num_of_students', 'Get the number of students doing a particular subject', 'SELECT COUNT( * ) AS numOfStudents\r\nFROM register\r\nWHERE subjects LIKE  ''%_SUBJECT_%''\r\nAND term = ''_TERM_''\r\nAND class = ''_CLASS_''', '2012-10-17 22:41:19'),
