INSERT INTO `appqueries` (`id`, `querycode`, `description`, `query`, `dateentered`) VALUES
(412, 'add_sponsor', 'add a sponsor', 'INSERT INTO sponsors (`school`,`firstname`,`lastname`,`middlename`,`gender`,`dob`,`nationality`,`address`,`address2`,`telephone`,`emailaddress`,`author`,`photo`) VALUES (''_SCHOOL_'',''_FIRSTNAME_'',''_LASTNAME_'',''_MIDDLENAME_'',''_GENDER_'',''_DOB_'',''_NATIONALITY_'',''_ADDRESS_'',''_ADDRESS2_'',''_TELEPHONE_'',''_EMAILADDRESS_'',''_AUTHOR_'',''_PHOTO_'')', '2014-02-07 00:00:00'),
(413, 'get_countries_list', 'Get a list of countries plus their continents', 'SELECT C.*, CTS.name AS continent FROM countries C LEFT OUTER JOIN continents CTS ON C.continent_code = CTS.code ', '2014-02-07 00:00:00'),
(414, 'student_sponsors', 'get a student''s sponsors', 'SELECT\r\n    `sponsors`.`sponsorid`\r\n,`studentsponsors`.`sponsorshipid`\r\n, `studentsponsors`.`dateadded`\r\n, `studentsponsors`.`fromdate`\r\n, `studentsponsors`.`todate`\r\n    , `students`.`school`\r\n    , `studentsponsors`.`sponsor`\r\n    , `sponsors`.`firstname` AS sponsorfirstname\r\n    , `sponsors`.`lastname` AS sponsorlastname\r\n    , `sponsors`.`gender`\r\n    , `sponsors`.`nationality`\r\n    , `sponsors`.`emailaddress`\r\n    , `sponsors`.`isactive`\r\n    , `sponsors`.`telephone`\r\n    , `students`.`firstname`\r\n    , `students`.`middlename`\r\nFROM\r\n    `sponsors`\r\n    INNER JOIN `studentsponsors` \r\n        ON (`sponsors`.`sponsorid` = `studentsponsors`.`sponsor`)\r\n    INNER JOIN `students` \r\n        ON (`students`.`id` = `studentsponsors`.`student`)\r\nWHERE sponsors.isactive=''Y'' _SEARCHSTRING_\r\nORDER BY _ORDERBY_ _LIMITTEXT_\r\n;', '2014-02-13 00:00:00'),
(415, 'add_student_sponsor', 'adds a sponsor to  a student', 'INSERT INTO studentsponsors (sponsor,student,fromdate,todate,author) VALUES(''_SPONSOR_'',''_STUDENT_'',''_FROMDATE_'',''_TODATE_'',''_AUTHOR_'')', '2014-02-13 00:00:00'),
(416, 'update_sponsor_info', 'Edit a sponsor''s basic data', 'UPDATE sponsors SET `firstname`=''_FIRSTNAME_'',`lastname`=''_LASTNAME_'',`middlename`=''_MIDDLENAME_'',`gender`=''_GENDER_'',`dob`=''_DOB_'',`nationality`=''_NATIONALITY_'',`address`=''_ADDRESS_'',`address2`=''_ADDRESS2_'',`telephone`=''_TELEPHONE_'',`emailaddress`=''_EMAILADDRESS_'',`author`=''_AUTHOR_'' _UPDATESTRING_ WHERE sponsorid = ''_EDITID_''', '2014-02-25 00:00:00'),
(417, 'get_student_sponsor_list', 'Get the students list', 'SELECT students.*, CONCAT(sponsors.firstname, '' '', sponsors.lastname) AS sponsorfullname, sponsorid FROM students LEFT JOIN studentsponsors ON students.id = studentsponsors.student LEFT JOIN sponsors ON studentsponsors.sponsor = sponsors.sponsorid WHERE students.isactive =''_ISACTIVE_'' AND (studentsponsors.isactive=''Y'' OR studentsponsors.isactive=''Y'' IS NULL)  AND (studentsponsors.iscurrent=''Y'' OR studentsponsors.iscurrent IS NULL)  _SEARCHSTRING_ ORDER BY firstname,lastname _LIMITTEXT_', '2012-11-29 22:12:29'),
(418, 'search_classes_register', 'get classes plus the number of registered students for a selected term', 'SELECT classes.id AS classid,classes.dateadded as classdateadded, classes.class as classname, numOfStudents, rank FROM classes LEFT OUTER JOIN (SELECT count(*) as numOfStudents, class FROM register WHERE term = _TERM_ GROUP BY Class) R ON R.class = classes.id WHERE classes.school = _SCHOOL_ ORDER BY classes.rank DESC _LIMITTEXT_', '2014-03-12 00:00:00'),
(419, 'school_accounts_overview', 'view account by account financial overview', 'SELECT fee_structure.fee as feename, fee_structure.id AS feeid, totalDebit, totalCredit FROM \r\n(SELECT fee, SUM(amount) as totalDebit FROM studentaccounts WHERE school = _SCHOOL_ AND type = ''DEBIT'' GROUP BY fee) AS D LEFT OUTER JOIN fee_structure ON fee_structure.id = D.fee LEFT OUTER JOIN\r\n(SELECT fee, SUM(amount) as totalCredit FROM studentaccounts WHERE school = _SCHOOL_ AND type = ''CREDIT'' GROUP BY fee) AS C ON fee_structure.id = C.fee\r\nWHERE fee_structure.school = _SCHOOL_ _SEARCHSTRING_\r\nGROUP BY fee_structure.fee', '2014-03-13 00:00:00'),
(425, 'get_stock_by_school', 'get stock that belongs to a school', 'SELECT * FROM stock WHERE school=''_SCHOOL_'' ORDER BY startdate DESC', '0000-00-00 00:00:00'),
(426, 'search_titles', 'Search through the list of titles', 'SELECT * FROM librarystock WHERE _SEARCHSTRING_ ORDER BY stocktitle _LIMITTEXT_', '2014-03-24 00:00:00'),
(427, 'insert_stock', 'insert new stock into the library', 'INSERT INTO `library` (`stockid`,`isbnnumber`,`serialnumber`, `dateadded`) VALUES (''_STOCKID_'',''_ISBNNUMBER_'',''_SERIALNUMBER_'', ''_DATEADDED_'')', '0000-00-00 00:00:00'),
(428, 'search_library', 'Search the library', 'SELECT * FROM library WHERE _SEARCHSTRING_', '2014-03-21 00:00:00'),
(429, 'get_num_of_book_transactions', 'GET NUMBER OF AVAILABLE COPIES OF A SELECTED BOOK', 'SELECT COUNT(*) as availableBooks FROM library WHERE id IN (SELECT id FROM librarytransactions WHERE id IN (SELECT id FROM librarytransactions WHERE transactiontype = ''RETURN'')) AND bookid = _BOOKID_', '2014-03-21 00:00:00'),
(430, 'add_library_transaction', 'Add library transaction', 'CALL add_library_transaction(_STOCKID_, _BORROWER_, ''_BORROWERTYPE_'', ''_DATEBORROWED_'', ''_EXPECTEDRETURNDE_'',\r\n''_RETURNDATE_'',''_TRANSACTIONTYPE_'',''_AUTHOR_,''_COMMENTS_'', ''_STATUS_'')', '2014-03-21 00:00:00'),
(431, 'search_students_users', 'Searches through a list of teachers and students', '(SELECT schoolusers.id AS userid, schoolusers.firstname AS userfirstname, schoolusers.lastname AS userlastname, "Staff" AS typeOfUser\r\nFROM schoolusers\r\nWHERE schoolusers.isactive = ''Y'' AND schoolusers.school = _SCHOOL_ AND (firstname like ''%_FIRSTNAME_%'' OR lastname like ''%_LASTNAME_%'') _LIMITTEXT_)\r\n\r\nUNION ALL\r\n\r\n(SELECT students.id AS userid, students.firstname AS userfirstname, students.lastname AS userlastname, "Student" AS typeOfUser\r\nFROM students\r\nWHERE students.isactive = ''Y'' AND students.school = _SCHOOL_ AND (firstname like ''%_FIRSTNAME_%'' OR lastname like ''%_LASTNAME_%'') _LIMITTEXT_) ORDER BY userfirstname', '2014-03-24 00:00:00'),
(432, 'search_library_with_titles', 'Gets the book isbn numbers along with their corresponding titles and author info', 'SELECT\r\n    `library`.`isbnnumber`\r\n    , `library`.`status` AS bookStatus\r\n    , `librarystock`.`stocktitle` AS bookTitle\r\n    , `librarystock`.`author` AS bookAuthor\r\n    , `library`.`id` AS booklibraryId\r\nFROM\r\n    `librarystock`\r\n    INNER JOIN `library` \r\n        ON (`librarystock`.`id` = `library`.`bookid`)\r\nWHERE librarystock.school = ''_SCHOOL_'' \r\nAND (isbnnumber LIKE ''%_ISBNNUMBER_%'' OR stocktitle LIKE ''%_STOCKTITLE_%'' OR author LIKE ''%_AUTHOR_%'') _SEARCHSTRING_ _LIMITTEXT_', '2014-03-24 00:00:00'),
(433, 'add_library_transaction_headers', 'adds a library transaction''s headers', 'INSERT INTO  librarytransactionheaders (borrowerid, borrowertype,author, school) VALUES (''_BORROWERID_'', ''_BORROWERTYPE_'',''_AUTHOR_'', ''_SCHOOL_'')', '2012-11-14 00:00:00'),
(434, 'add_library_transaction_details', 'Inserts library transaction details', 'INSERT INTO `librarytransactions`\r\n            (`batchno`,\r\n            `stockid`,\r\n             `expectedreturndate`,\r\n             `transactiontype`)\r\n	VALUES _VALUES_', '2014-03-26 00:00:00'),
(435, 'update_library_stock_status', 'Updates the status of a book in the library', 'UPDATE  library SET  status = ''_STATUS_'' WHERE id IN (_BOOKS_)', '2012-11-14 00:00:00'),
(436, 'get_sections', 'Get all section data', 'SELECT * FROM sections ORDER BY id DESC', '2014-03-28 00:00:00'),
(437, 'search_students_by_term_and_class', 'Search for students by class and term', 'SELECT\n  students.*,\n  CONCAT(sponsors.firstname, '' '', sponsors.lastname) AS sponsorfullname,\n  sponsors.sponsorid,\n  terms.term,\n  terms.year,\n  classes.class\nFROM students\n  LEFT OUTER JOIN studentsponsors\n    ON students.id = studentsponsors.student\n  LEFT OUTER JOIN sponsors\n    ON studentsponsors.sponsor = sponsors.sponsorid\n  LEFT OUTER JOIN register\n    ON students.id = register.student\n  INNER JOIN classes\n    ON classes.id = register.class\n  INNER JOIN terms\n    ON terms.id = register.term\nWHERE students.isactive = ''Y'' \n  AND (studentsponsors.isactive = ''Y'' OR studentsponsors.isactive = ''Y'' IS NULL) \n  AND (studentsponsors.iscurrent = ''Y'' OR studentsponsors.iscurrent IS NULL) \n  AND students.school = _SCHOOL_ \n  AND (students.firstname LIKE ''%_FIRSTNAME_%'' OR students.lastname LIKE ''%_LASTNAME_%'' OR students.studentno LIKE ''%_STUDENTNO_%'' OR sponsors.firstname LIKE ''%_SPONSORFIRSTNAME_%'' OR sponsors.lastname LIKE ''%_SPONSORLASTNAME_%'')\n  _SEARCHSTRING_\nGROUP BY students.id\n_LIMITTEXT_', '2014-05-12 16:59:11'),
(438, 'add_single_library_transaction', 'Inserts single library transaction details', 'INSERT INTO `librarytransactions`\r\n            (`batchno`,\r\n            `stockid`,\r\n             `expectedreturndate`,\r\n             `transactiontype`,`returndate`,`author`,`comments`)\r\n	VALUES (''_BATCHNO_'', ''_STOCKID_'',''_EXPECTEDRETURNDATE_'', ''_TRANSACTIONTYPE_'',''_RETURNDATE_'',''_AUTHOR_'', ''_COMMENTS_'')', '2014-03-26 00:00:00'),
(439, 'search_library_transactions', 'Search library transactions', 'SELECT\r\n  librarystock.stocktitle,\r\n  library.isbnnumber,\r\n  library.bookid,\r\n  library.id AS stockid,\r\n  librarytransactions.expectedreturndate,\r\n  librarytransactionheaders.transactiondate,\r\n  librarytransactionheaders.borrowerid,\r\n  librarytransactionheaders.borrowertype,\r\n  users.firstname AS userfirstname,\r\n  users.lastname AS userlastname,\r\n  librarytransactionheaders.author AS userid,\r\nlibrarystock.author\r\nFROM librarytransactionheaders\r\n  INNER JOIN librarytransactions\r\n    ON librarytransactionheaders.headerid = librarytransactions.batchno\r\n  INNER JOIN library\r\n    ON library.id = librarytransactions.stockid\r\n  INNER JOIN librarystock\r\n    ON librarystock.id = library.bookid\r\n  INNER JOIN users\r\n    ON users.id = librarytransactionheaders.author\r\n  WHERE _SEARCHSTRING_ _ORDERBY_ _LIMITTEXT_', '2014-04-17 00:00:00'),
(440, 'search_library_transactions_with_titles', 'Search for a book''s last borrow and return transactions', 'SELECT \n  latestBorrowTrans.typeBorrow \n  ,latestBorrowTrans.lastBorrowTransDate\n  ,latestReturnTrans.lastReturnTransDate\n  ,latestReturnTrans.typeReturn,\n  `library`.`isbnnumber`\n  ,`library`.`status` AS bookStatus\n  ,`librarystock`.`stocktitle` AS bookTitle\n  ,`librarystock`.`author` AS bookAuthor\n  ,`library`.`id` AS booklibraryId\n   \n  FROM `librarystock` INNER JOIN `library` \n  ON (`librarystock`.`id` = `library`.`bookid`) \n  LEFT JOIN ( SELECT MAX(dateadded) AS lastBorrowTransDate, \n\nstockid, librarytransactions.transactiontype  AS typeBorrow FROM \n\nlibrarytransactions WHERE transactiontype = ''BORROW'' \nGROUP BY stockid) latestBorrowTrans ON latestBorrowTrans.stockid \n\n= library.id\n  LEFT JOIN ( SELECT MAX(dateadded) AS lastReturnTransDate, \n\nstockid, librarytransactions.transactiontype  AS typeReturn FROM \n\nlibrarytransactions WHERE transactiontype = ''RETURN'' \nGROUP BY stockid) latestReturnTrans ON latestReturnTrans.stockid \n\n= library.id\n  WHERE librarystock.school = ''10'' AND (isbnnumber LIKE \n\n''%_ISBNNUMBER_%'' OR stocktitle LIKE ''%_STOCKTITLE_%'' OR author \n\nLIKE ''%_AUTHOR_%'') _LIMITTEXT_', '2014-04-16 00:00:00'),
(441, 'count_classes', 'SELECT coount(*) FROM classes WHERE isactive = ''_ISACTIVE_'' _SEARCHSTRING_ ORDER BY rank DESC _LIMITTEXT_', 'SELECT count(*) as class_count FROM classes WHERE isactive = ''_ISACTIVE_'' _SEARCHSTRING_ ORDER BY rank DESC _LIMITTEXT_', '2014-07-03 00:00:00'),
(442, 'count_terms', 'select count(*),year from terms WHERE isactive = ''_ISACTIVE_'' _SEARCHSTRING_   group by year order by year DESC  limit 1', 'select count(*) as terms ,year from terms WHERE isactive = ''_ISACTIVE_'' _SEARCHSTRING_   group by year order by year DESC  limit 1', '2014-07-03 00:00:00'),
(443, 'count_school_users', 'SELECT count(*) as schoolusers  FROM schoolusers WHERE _SEARCHSTRING_', 'SELECT count(*) as schoolusers  FROM schoolusers WHERE _SEARCHSTRING_', '2014-07-03 00:00:00'),
(444, 'count_books_transacted', 'select count(*) as books from library where _SEARCHSTRING_\r\n', 'select count(*) as books from library where _SEARCHSTRING_\r\n', '2014-07-03 00:00:00'),
(445, 'count_defaulters', 'select * from borrowers where returndate < NOW() and _SEARCHSTRING_', 'select count(*) as defaulters  from borrowers where returndate < NOW() and _SEARCHSTRING_', '2014-07-03 00:00:00'),
(446, 'total_finances', 'SELECT fee, SUM(amount) as total FROM studentaccounts WHERE _SEARCHSTRING_', 'SELECT fee, SUM(amount) as total FROM studentaccounts WHERE _SEARCHSTRING_', '2014-07-03 00:00:00'),
(447, 'count_student_list', 'SELECT (*) FROM students WHERE isactive =''_ISACTIVE_'' _SEARCHSTRING_ ORDER BY firstname,lastname _LIMITTEXT_', 'SELECT count(*) as num FROM students WHERE isactive =''_ISACTIVE_'' _SEARCHSTRING_ ORDER BY firstname,lastname _LIMITTEXT_', '2014-07-03 00:00:00'),
(448, 'add_incident', 'Add disciplinary incidents', 'INSERT INTO discipline\r\n(\r\n  student\r\n ,reportedby\r\n ,incidentdate\r\n ,incidentdetails\r\n ,response\r\n ,actiontaken\r\n ,author\r\n)\r\nVALUES\r\n(\r\n  ''_STUDENT_''\r\n ,''_REPORTEDBY_''\r\n ,''_INCIDENTDATE_''\r\n ,''_INCIDENTDETAILS_''\r\n ,''_RESPONSE_''\r\n ,''_ACTIONTAKEN_''\r\n ,''_AUTHOR_''\r\n)', '2014-06-23 14:36:23'),
(449, 'search_discipline', 'searches through the discipline table', 'SELECT\r\n  discipline.reportedby,\r\n  discipline.incidentid,\r\n  discipline.student,\r\n  discipline.incidentdate,\r\n  discipline.incidentdetails,\r\n  discipline.response,\r\n  discipline.actiontaken,\r\n  discipline.isactive,\r\n  discipline.dateadded,\r\n  discipline.author,\r\n  students.firstname AS studentfirstname,\r\n  students.middlename AS studentmiddlename,\r\n  students.lastname AS studentlastname,\r\n  CONCAT(students.firstname, '' '', students.middlename, '' '', students.lastname) AS studentfullname,\r\n  schoolusers.firstname AS userfirstname,\r\n  schoolusers.lastname AS userlastname,\r\n  schoolusers.middlename AS usermiddlename,\r\n  CONCAT(schoolusers.firstname, '' '', schoolusers.middlename, '' '', schoolusers.lastname) AS userfullname\r\nFROM discipline\r\n  INNER JOIN students\r\n    ON discipline.student = students.id\r\n  INNER JOIN schoolusers\r\n    ON discipline.reportedby = schoolusers.id\r\n  WHERE students.school = _SCHOOL_ AND _SEARCHSTRING_', '2014-06-23 11:48:57'),
(450, 'get_library_stock_by_id', 'get_library_stock_by_id Get Library Stock by ID ', 'SELECT * FROM librarystock WHERE id=''_ID_''', '2014-07-04 00:00:00'),
(451, 'check_schoolusername', 'SELECT * FROM schoolusers where username like ''_USERNAME_'' and not id = ''_ID_''\r\n', 'SELECT * FROM schoolusers where( username like ''_USERNAME_'' or emailaddress like ''_EMAIL_%''  ) AND id <> ''_EDITID_''', '2014-07-11 00:00:00'),
(452, 'user_update_school_data', 'UPDATE SCHOOL INFO', 'UPDATE schools SET schoolname=''_SCHOOLNAME_'', district=''_DISTRICT_'', telephone=''_TELEPHONE_'', address=''_ADDRESS_'', emailaddress=''_EMAILADDRESS_'', logourl=''_PHOTO_'' WHERE id = ''_EDITID_''', '2014-08-14 00:00:00'),
(453, 'search_register2', 'search reg 2', '\r\n  SELECT register.school,register.student,register.class,register.subjects,register.author,terms.term,terms.startdate,terms.enddate,terms.dateadded,terms.year FROM register \r\n  INNER JOIN terms \r\n  ON register.term = terms.id \r\n  \r\n  WHERE 1=1 AND _SEARCHSTRING_ ORDER BY terms.dateadded DESC  _LIMITTEXT_', '2015-05-18 00:00:00'),
(454, 'new_system_account', 'New System Account', 'INSERT IGNORE\r\n  INTO academia_accounts\r\n  (account_name,email,user_name,`password`,`isactive`,dateadded)\r\n  VALUES(''_ACCOUNT_NAME_'',''_ACCOUNT_EMAIL_'',''_ACCOUNT_USERNAME_'',''_ACCOUNT_PASSWORD_'',''_ISACTIVE_'',NOW())\r\n', '2016-01-19 00:00:00'),
(455, 'search_academia_account', 'Search Academia Account', 'SELECT * FROM academia_accounts AA\r\n  WHERE AA.account_name LIKE ''_ACCOUNT_NAME_'' AND AA.email LIKE ''_ACCOUNT_EMAIL_''\r\n', '2016-01-19 00:00:00'),
(456, 'search_acadmia_schools', 'Search Academia Schools Associated to Account ', 'SELECT * FROM schools SS INNER JOIN academia_accounts  AA\r\n  ON  SS.account_id = AA.id WHERE _SEARCHSTRING_\r\n', '2016-01-19 00:00:00');
