INSERT INTO `messages` (`id`, `subject`, `details`, `sentby`, `datesent`, `sendingip`, `isactive`) VALUES
(1, 'This is a test', 'This is a test man.\n\nAnother line in the test.\n\nRegards,\n\nAl', '2', '2013-01-02 03:30:19', '127.0.0.1', 'Y'),
(2, 'This is a test', 'This is a test man.\n\nAnother line in the test.\n\nRegards,\n\nAl', '2', '2013-01-02 03:31:13', '127.0.0.1', 'Y'),
(3, 'A great sweater here', 'This is a great sweater.\n\nCheck it out next.\n\nCheers!', '2', '2013-01-02 03:44:46', '127.0.0.1', 'Y'),
(4, 'A message from Yahoo.com', 'Hey this is a message from yahoo.com.\n\nDo you believe it?\n\nMan - these a good times!', '2', '2013-01-03 02:21:04', '127.0.0.1', 'Y'),
(5, 'Another Test with 2 outsiders', 'This is a test with the outsiders.\n\nOutsiders are not included in the list.\n\nTester.', '2', '2013-01-03 02:30:56', '127.0.0.1', 'Y'),
(6, 'Showing the Outsiders', 'showing the outsiders.\n\nTell me you receive this.', '2', '2013-01-03 02:32:55', '127.0.0.1', 'Y'),
(8, 'Music is all I have', 'Music is all I have dear.\n\nTell me you can hear it.', '2', '2013-01-03 02:35:01', '127.0.0.1', 'Y'),
(12, 'There is a good thing there', 'This is a good thing here. Just check it out and make sure that it works.\n\nRegards,\n\nKinton', '2', '2013-01-03 02:41:36', '127.0.0.1', 'Y'),
(13, 'This is a non-admin saying hi', 'This is just a test of sorts. Just to make sure you all get my message.\n\nLet me know.\n\nCheers!', '1', '2013-01-03 21:49:44', '127.0.0.1', 'Y'),
(14, 'RE: This is a non-admin saying hi', 'Please stop sending test messages.\n\nThanks for your feedback.\n\nAdmin\n\nOn 01/03/2013 09:49PM John Client (jclient@nyppex.com) wrote\n------------------------------------------\nThis is just a test of sorts. Just to make sure you all get my message.\n\nLet me know.\n\nCheers!', '2', '2013-01-03 22:46:42', '127.0.0.1', 'Y'),
(15, 'RE: This is a test', 'This is a reply\nregards,\nVictor\n\n\n\nOn 01/02/2013 03:30AM Jane Admin (jadmin@nyppex.com) wrote\n------------------------------------------\nThis is a test man.\n\nAnother line in the test.\n\nRegards,\n\nAl', '2', '2013-01-18 05:27:19', '41.202.240.4', 'Y');
